    [],nt"revision_timestamp": "2016-07-27T22:55:58.268327",nt"name": "big-stone-national-wildlife-refuge-annual-narrative-report-calendar-year-1991",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Big Stone
    NWR outlines Refuge accomplishments during the 1991 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses the master plan,
    management plan, public participation, compliance with environmental and cultural
    resource mandates, and research and investigations. Refuge administration is outlined;
    information about personnel, other manpower programs, volunteer programs, funding,
    safety, and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, croplands, grasslands, grazing, fire management, and pest control.
    The wildlife section of the report discusses wildlife diversity, endangered and
    threatened species, waterfowl, marsh birds and waterbirds, raptors, game mammals,
    other resident wildlife, scientific collections, and marking and banding. The public
    uses of the Refuge described in this report include outdoor classrooms, interpretive
    programs, hunting, fishing, trapping, wildlife observation, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, major maintenance, equipment utilization and replacement,
    communication systems, and computer systems. Cooperative programs, other economic
    uses of the Refuge, and items of interest are provided at the end. Photographs and
    refuge brochures are attached.",nt"license_title": "License Not Specified",nt"extras":
